import React from 'react'
import {Container,Row,Col} from 'react-bootstrap';

const Footer = () => {
  return (
    <>
        <Container>
            <Row>
                <Col>
                    Copyright @copy
                </Col>
            </Row>
        </Container>
    </>
  )
}

export default Footer
